import * as React from 'react';
import { styled } from '@mui/material/styles';
import Button from '@mui/material/Button';
import CloudUploadIcon from '@mui/icons-material/CloudUpload';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import {lightBlue} from '@mui/material/colors';
import { useState } from "react";



export default function AddMovie() {
    
    const [movieTitle, setMovieTitle] = useState("");
    const [producer, setProducer] = useState("");
    const [director, setDirector] = useState("");
    const [cast, setCast] = useState("");
    const [rating, setRating] = useState("");
    const [description, setDescription] = useState("");
    const [image, setImage] = useState("");
    const [trailer, setTrailer] = useState("");
    const [promo, setPromo] = useState("");



    function handleSubmit(e) {
        e.preventDefault();
        window.location.assign("http://localhost:3000/manage");
        alert("Movie Added");
        
    }

    return (
        
        <body className= "reg"> 
            <h1>Add Movie</h1>
            <form onSubmit={handleSubmit}>
                <div className="input-group">
                    Movie Title
                <label htmlFor="movieTitle"></label>
                <input type="text" onChange={event => {setMovieTitle(event.target.value)}}/>
                </div>

                <div className="input-group">
                    Producer
                <label htmlFor="producer"></label>
                <input type="text" onChange={event => {setProducer(event.target.value)}} />
                </div>

                <div className="input-group">
                    Director
                <label htmlFor="director"></label>
                <input type="text" onChange={event => {setDirector(event.target.value)}} />
                </div>

                <div className="input-group">
                    Cast
                <label htmlFor="cast"></label>
                <input type="text" onChange={event => {setCast(event.target.value)}} />
                </div>

                <div className="input-group">
                    Image URL
                <label htmlFor="image"></label>
                <input type="text" onChange={event => {setImage(event.target.value)}} />
                </div>

                <div className="input-group">
                    Trailer URL
                <label htmlFor="trailer"></label>
                <input type="text" onChange={event => {setTrailer(event.target.value)}} />
                </div>

                <div> 
                    Rating
                    <select onChange={event => {setRating(event.target.value)}}>
                        <option value="G">G</option>
                        <option value="PG-13">PG-13</option>
                        <option value="R">R</option>
                        <option value="Adult">18+</option>
                    </select>
                </div>

                <div className="input-group">
                    Description
                <label htmlFor="description"></label>
                <textarea
                row={5} 
                cols={5} 
                onChange={event => {setDescription(event.target.value)}}/>
                </div>

                <div>
                <FormGroup>
                    <FormControlLabel control={<Checkbox onChange={event=> {setPromo(event.target.value)}} sx={{color: lightBlue[800],'&.Mui-checked': {color: lightBlue[600],},}}/>} label="Currenty Showing"  />
                </FormGroup>
                </div>


                <button type="submit" className="submit-btn">
                Submit
                </button>
            </form>
            
            
        </body>
        
        
    )
}
